import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link, useNavigate } from "react-router-dom";
import { GetTotalCart } from "../Redux/CartSlice";

const Navbar = () => {
  const dispatch = useDispatch();
  const { Cart } = useSelector(state => state.name);
  const navigate = useNavigate();

  const LogoutAdmin = () => {
    localStorage.removeItem("Token");
    navigate("/login");
  };

  const LogoutUser = () => {
    localStorage.removeItem("UserToken");
    navigate("/login");
  };

  useEffect(() => {
    dispatch(GetTotalCart());
  }, [dispatch]);

  return (
    <>
      {localStorage.getItem("Token") ? (
     <nav className="navbar navbar-expand-lg bg-body-tertiary fixed-top">
  <div className="container">
    <a className="navbar-brand" href="#">Navbar</a>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon" />
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">
      
        
      </ul>
      <form className="d-flex" role="search">
        
     <Link to='/login'>
     <button className="btn btn-outline-success">Login</button>
     </Link>
      </form>
    </div>
  </div>
</nav>

      ) : (
       <nav className="navbar navbar-expand-lg bg-body-tertiary fixed-top">
  <div className="container-fluid">
    <Link to='/' className="navbar-brand">Klasen Fabrics</Link>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon" />
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">
        <li className="nav-item">
          <Link to='/pro' className="nav-link active" aria-current="page" >Products</Link>
        </li>
       
      </ul>
      <form className="d-flex" role="search">
       
        <button onClick={Log} className="btn btn-outline-danger" >Logout</button>
      </form>
    </div>
  </div>
</nav>

      )}
    </>
  );
};

export default Navbar;
